import React from 'react'
import './banner.css'
import axios from 'axios'
function Banner() {
  return (
    <div className='banner'>
      <div className='content'>
      <h1 className='title'>Movie Name</h1>
         <div className='Banner_button'>
               <button className='Button' onClick={()=>{
                 axios.get('https://api.themoviedb.org/3/genre/movie/list?api_key=61f463dc9387af6cc3d60ea5e9251be2&language=en-US').then((response)=>{
                   console.log(response.data)
                 })
               }}>Play</button>
               <button className='Button'>MyList</button>
          </div>
          <h1 className='discription'>Vic and Melinda Van Allen are a couple in the small town of Little Wesley. Their loveless marriage is held together only by a precarious arrangement whereby, in order to avoid the messiness of divorce, Melinda is allowed to take any number of lovers as long as she does not desert her family.</h1>

      
      </div>
    </div>
  )
}

export default Banner
